import 'braft-editor/dist/index.css'
import React from 'react'
import {Button} from 'antd'
import BraftEditor from 'braft-editor'

export default class BasicDemo extends React.Component {

    state = {
        editorState: BraftEditor.createEditorState('<p>Hello <b>World!</b></p>'), // 设置编辑器初始内容
        outputHTML: '<p></p>'
    }

    componentDidMount () {
        this.isLivinig = true
        // 3秒后更改编辑器内容
        setTimeout(this.setEditorContentAsync, 3000)
    }

    componentWillUnmount () {
        this.isLivinig = false
    }

    handleChange = (editorState) => {
        this.setState({
            editorState: editorState,
            outputHTML: editorState.toHTML()
        })
    }

    tijiao = () => {

    }

    setEditorContentAsync = () => {
        this.isLivinig && this.setState({
            editorState: BraftEditor.createEditorState('<p><strong>加粗<span style="color:#c0392b">颜色<em>斜体<u>下划线<span style="text-decoration:line-through">删除线</span></u></em></span></strong>😻😻😻😻😻😻</p><div class="media-wrap audio-wrap"><audio controls="" src="http://music.taihe.com/song/285075"></audio></div><p></p><div class="media-wrap image-wrap"><img src="data:image/png;base64,"/></div><p></p>')
        })
    }
    // submitContent = async () => {
    //     // 在编辑器获得焦点时按下ctrl+s会执行此方法
    //     // 编辑器内容提交到服务端之前，可直接调用editorState.toHTML()来获取HTML格式的内容
    //     const htmlContent = this.state.editorState.toHTML()
    //     const result = await saveEditorContent(htmlContent)
    // }
    render () {

        const { editorState, outputHTML } = this.state

        return (
            <div style={{padding:50}}>
                <div className="editor-wrapper">
                    <BraftEditor
                        value={editorState}
                        onChange={this.handleChange}
                        // onSave={this.submitContent}
                    />
                </div>
                <Button size="large" type="primary" onClick={this.tijiao}>提交</Button>
                <h5>输出内容</h5>
                <div className="output-content">{outputHTML}</div>
            </div>
        )

    }

}